import { Link } from "react-router-dom";



const Navbar = () => {
    return (    
        <header>
            <div className="container">
                <Link to="/">
                    <h1>To-Doom</h1>
                </Link>
                <nav>
                    <div>
                        <button onClick={handleLogout}>Logout</button>
                    </div>
                    <Link to="/login">Login</Link>
                    <Link to="/signup">Signup</Link>
                </nav>
            </div>
        </header>     
    )
}

export default Navbar;
